import * as React from 'react';
import { styled } from '@mui/material/styles';
import Box from '@mui/material/Box';
import Grid from '@mui/material/Grid';
import { Paper } from '@material-ui/core';
import { Table } from '@mui/material';
import TableBody from '@mui/material/TableBody';
import TableCell, { tableCellClasses } from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import { KeyboardArrowLeft } from "@mui/icons-material";
import Avatar from '@mui/material/Avatar';
import { Button } from '@mui/material';



const StyledTableCell = styled(TableCell)(({ theme }) => ({
    [`&.${tableCellClasses.head}`]: {
      backgroundColor: theme.palette.common.gray,
      color: theme.palette.common.black,
    },
    [`&.${tableCellClasses.body}`]: {
      fontSize: 14,
    },
  }));

  const StyledTableRow = styled(TableRow)(({ theme }) => ({
    '&:nth-of-type(odd)': {
      backgroundColor: theme.palette.action.hover,
    },
    // hide last border
    '&:last-child td, &:last-child th': {
      border: 0,
    },
  }));
  function createData( Education,Name, Marks, MarksType) {
    return {Education, Name, Marks, MarksType };
  }
  const rows = [
    createData('University',"abcd high school", 68,"%"),
    createData('xii',"loyala public school", 8.0, "CGPA", ),
    createData('x', "delhi public school patna", 80, "%"),

  ];
  function createData2(  Internship, CompanyName, Designation, Duration,CertificateLink) {
    return {Internship, CompanyName,Designation,Duration,CertificateLink };
  }

  const row = [
    createData2('1',"abcd high school", "Graphic Designer", 5,"abcddddddddddddddddddd"),
    createData2('2',"loyala public school", "Software Devloper",6, "dsdjkbjkmvlsdjdskbnkmvljsdibnkmlvidjv", ),
    createData2('3', "delhi public school patna", "Web developer",3,"bfdnjkmcsvjeoib momkdvvnfjdnln fijjjjjjjjjfiv"),

  ];

  function createData3(  Certifications, CertName, Organization, StartDate, duration,CertificateLink) {
    return {Certifications, CertName,Organization,StartDate,duration,CertificateLink };
  }

  function createData4(  Projects, ProjName, Description, CodeLink,DemoLink) {
    return {Projects, ProjName,Description,CodeLink,DemoLink };
  }
  const row1 = [
    createData3('1',"java", "Google", 9885,5,"abcddddddddddddddddddd"),
    createData3('2',"web developer bootcamp", "Udemy",5667,6, "dsdjkbjkmvlsdjdskbnkmvljsdibnkmlvidjv", ),
    createData3('3', "dpython", "coding Ninja",3648,7,"bfdnjkmcsvjeoib momkdvvnfjdnln fijjjjjjjjjfiv"),

  ];

  const row2 = [
    createData4('1',"fjkvsugibnkmkvsi", "GraphicDesignersjfkibubjnvkmdvjnfnn", "bfjkvjbkfnmvfjbuhoalsmbkufgjiu","abcddddddddddddddddddd"),
    createData4('2',"ngfkjgewjisbnsbmkjifnhkm", "SoftwareDevloperdjkb nmisjihn","vmckbjibnfjkvmfkjdbhiueeqjog", "dsdjkbjkmvlsdjdskbnkmvljsdibnkmlvidjv", ),
    createData4('3', "bkjiwsmiuwgbkmek", "Webdeveloperfbjghwoinvkmeifjiokjiuv","kbnbjiekbnm k","bfdnjkmcsvjeoib momkdvvnfjdnln fijjjjjjjjjfiv"),

  ];
  
  function createData5(Skills) {
    return {Skills};
  }
  const row3 = [
    createData5("python"),
    createData5("java"),
    createData5("Web devloping"),

  ];

  function createData6( Coactivity,Name,Description) {
    return { Coactivity,Name,Description};
  }

  const row4 = [
    createData6('1', "Co-curricular1","played it"),
    createData6('2',"co-curricular2","well played"),
  ];
  
const Item = styled(Paper)(({ theme }) => ({
    backgroundColor: theme.palette.mode === 'dark' ? '#1A2027' : '#fff',
    ...theme.typography.body2,
    padding: theme.spacing(1),
    textAlign: 'left',
    color: theme.palette.text.secondary,
  }));

  const onDownload = () => {
    const link = document.createElement("a");
    link.download = `download.txt`;
    link.href = "./download.txt";
    link.click();
  };


const Myprofile = () => {
  return (

    <div>
    <div
    style={{ width: "100wv", height: "50px", background: "rgb(30,71,134)" }}
  >
    <a
      style={{
        border: "none",
        background: "rgb(30,71,134)",
        color: "white",
        fontSize: "24px",
      }}
      href="./Home"
    >
      <KeyboardArrowLeft style={{ marginTop: "4px", paddingTop: "10px" }} />
      Back
    </a>
  </div>
    

    <Box sx = {{flexGrow :1 , backgroundColor :"orange" ,display : "flex",justifyContent : "right",textAlign : "center" , height : 130}}>
        <h1 style= {{marginTop : "40px"}}> Sonam Kumari</h1>
        <Avatar
            alt="Remy Sharp"
           src="/static/images/avatar/1.jpg"
           sx={{ width: 100, height: 100,marginTop:'10px',marginLeft : '25px',marginRight : "50px"}}
           />
    </Box>
    <br/>
    <br/>
    <Box sx={{ flexGrow: 1 }}>
      <Grid container spacing={2}>
        <Grid item xs={8} >
          <Item>Name:</Item>
          
        </Grid>
        <Grid item xs={4}>
          <Item>USN:</Item>
        </Grid>
        <Grid item xs={4}>
          <Item>Contact No:</Item>
        </Grid>
        <Grid item xs={6}>
          <Item>Email:</Item>
        </Grid>
        <Grid item xs={2}>
          <Item>Gender:</Item>
        </Grid> 
        <Grid item xs={6}>
          <Item>Linkedln:</Item>
        </Grid>
        <Grid item xs={6}>
          <Item>Github:</Item>
        </Grid>
      </Grid>
      <br/>
      <br/>
     <TableContainer component={Paper}>
      <Table sx={{ minWidth: 700 }} aria-label="customized table">
        <TableHead>
          <TableRow>
            <StyledTableCell>Education</StyledTableCell>
            <StyledTableCell align="right">Name</StyledTableCell>
            <StyledTableCell align="right">Marks</StyledTableCell>
            <StyledTableCell align="right">MarksType</StyledTableCell>
        
          </TableRow>
        </TableHead>
        <TableBody>
          {rows.map((row) => (
            <StyledTableRow key={row.Education}>
              <StyledTableCell component="th" scope="row">
                {row.Education}
              </StyledTableCell>
              <StyledTableCell align="right">{row.Name}</StyledTableCell>
              <StyledTableCell align="right">{row.Marks}</StyledTableCell>
              <StyledTableCell align="right">{row.MarksType}</StyledTableCell>
      
            </StyledTableRow>
          ))}
        </TableBody>
      </Table>
    </TableContainer>
    <Grid container spacing={2} marginTop = {1}>
    <Grid item xs={6}>
          <Item>Active Backs:</Item>
        </Grid>
        <Grid item xs={6}>
          <Item>History of Backs:</Item>
        </Grid>
    </Grid>
    <br/>
    <br/>
    <TableContainer component={Paper}>
      <Table sx={{ minWidth: 700 }} aria-label="customized table">
        <TableHead>
          <TableRow>
            <StyledTableCell>Internship</StyledTableCell>
            <StyledTableCell align="right">Company Name</StyledTableCell>
            <StyledTableCell align="right">Designation</StyledTableCell>
            <StyledTableCell align="right">Duration</StyledTableCell>
            <StyledTableCell align="right">Certificate Link</StyledTableCell>
        
          </TableRow>
        </TableHead>
        <TableBody>
          {row.map((row) => (
            <StyledTableRow key={row.Internship}>
              <StyledTableCell component="th" scope="row">
                {row.Internship}
              </StyledTableCell>
              <StyledTableCell align="right">{row. CompanyName}</StyledTableCell>
              <StyledTableCell align="right">{row.Designation}</StyledTableCell>
              <StyledTableCell align="right">{row.Duration}</StyledTableCell>
              <StyledTableCell align="right">{row.CertificateLink}</StyledTableCell>
      
            </StyledTableRow>
          ))}
        </TableBody>
      </Table>
    </TableContainer>
    <br/>
    <br/>
    <TableContainer component={Paper}  marginTop = {10}>
      <Table sx={{ minWidth: 700 }} aria-label="customized table">
        <TableHead>
          <TableRow>
            <StyledTableCell>Certifications</StyledTableCell>
            <StyledTableCell align="right">Certificate Name</StyledTableCell>
            <StyledTableCell align="right">Organization</StyledTableCell>
            <StyledTableCell align="right">Start Date</StyledTableCell>
            <StyledTableCell align="right">Duration</StyledTableCell>
            <StyledTableCell align="right">Certificate Link</StyledTableCell>
        
          </TableRow>
        </TableHead>
        <TableBody>
          {row1.map((row) => (
            <StyledTableRow key={row.Certifications}>
              <StyledTableCell component="th" scope="row">
                {row.Certifications}
              </StyledTableCell>
              <StyledTableCell align="right">{row.CertName}</StyledTableCell>
              <StyledTableCell align="right">{row.Organization}</StyledTableCell>
              <StyledTableCell align="right">{ row.StartDate}</StyledTableCell>
             < StyledTableCell align="right">{row.duration}</StyledTableCell>
              <StyledTableCell align="right">{row.CertificateLink}</StyledTableCell>
      
            </StyledTableRow>
          ))}
        </TableBody>
      </Table>
    </TableContainer>
    <br/>
    <br/>
    <TableContainer component={Paper}  marginTop = {10}>
      <Table sx={{ minWidth: 700 }} aria-label="customized table">
        <TableHead>
          <TableRow>
            <StyledTableCell> Projects</StyledTableCell>
            <StyledTableCell align="right">Project Name</StyledTableCell>
            <StyledTableCell align="right">Description</StyledTableCell>
            <StyledTableCell align="right">Code Link</StyledTableCell>
            <StyledTableCell align="right">Demo Link</StyledTableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {row2.map((row) => (
            <StyledTableRow key={row.Projects}>
              <StyledTableCell component="th" scope="row">
                {row.Projects}
              </StyledTableCell>
              <StyledTableCell align="right">{row.ProjName}</StyledTableCell>
              <StyledTableCell align="right">{row.Description}</StyledTableCell>
              <StyledTableCell align="right">{ row.CodeLink}</StyledTableCell>
              <StyledTableCell align="right">{row.DemoLink}</StyledTableCell>
      
            </StyledTableRow>
          ))}
        </TableBody>
      </Table>
    </TableContainer>
    <br/>
    <br/>
    <Grid containerstyle = {{paddingBottom : "50px", borderBottom : "1px solid white" , direction : "row"}}>
        <Grid item container xs={6} style = {{color:"white" , justifyContent : "center"}}  >
    <TableContainer component={Paper}  marginTop = {10}>
      <Table sx={{ minWidth: 700 }} aria-label="customized table">
        <TableHead>
          <TableRow>
            <StyledTableCell> Skills</StyledTableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {row3.map((row) => (
            <StyledTableRow key={row.Skills}>
              <StyledTableCell component="th" scope="row">
                {row.Skills}
              </StyledTableCell>
            </StyledTableRow>
          ))}
        </TableBody>
      </Table>
    </TableContainer>
    </Grid>
    <Grid item container xs={6} >
    <TableContainer component={Paper}  marginTop = {10}>
      <Table sx={{ minWidth: 700 }} aria-label="customized table">
        <TableHead>
          <TableRow>
            <StyledTableCell> Co-Activity</StyledTableCell>
            <StyledTableCell> Name</StyledTableCell>
            <StyledTableCell> Description</StyledTableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {row4.map((row) => (
            <StyledTableRow key={row.Coactivity}>
              <StyledTableCell component="th" scope="row">
                {row.Coactivity}
              </StyledTableCell>
              < StyledTableCell align="right">{row.Name}</StyledTableCell>
              < StyledTableCell align="right">{row.Description}</StyledTableCell>

            </StyledTableRow>
          ))}
        </TableBody>
      </Table>
    </TableContainer>
    </Grid>
    </Grid>
    

    </Box>
    <div   >
              <Button onClick={onDownload} variant="contained" color="primary" display = "flex" justifyContent= 'center' >
              Download Resume
              </Button>
              </div>

    </div>
  );
}
  
export default Myprofile
